import React from 'react'
import "./Home.css"
import NavBar from '../NavBar/NavBar'
import MainContent from '../MainContent/MainContent'


function Home() {
  return (
    <div style={{ display: 'flex' }}>
      <NavBar style={{ flex: '0 0 20%' }} />
      <MainContent style={{ flex: '1' }} />
    </div>
  )
}

export default Home
